import MeetupItem from "./MeetupItem.js";
function MeetupList(props) {
	return (
		<ul>
			{props.meetups.map((meetup) => {
				<MeetupItem 
        key={meetup.id}
        location={meetup.location}
        image={meetup.image}
        description={meetup.description} 
        />;
			})}
		</ul>
	);
}

export default MeetupItem;
